import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import { Card, Button, Container, Row, Col, Form } from "react-bootstrap";

function VehicleList() {
  const [vehicles, setVehicles] = useState([]);
  const [search, setSearch] = useState("");
  const [type, setType] = useState(""); // Car or Bike
  const [fuelType, setFuelType] = useState("");
  const [minPrice, setMinPrice] = useState("");
  const [maxPrice, setMaxPrice] = useState("");

  useEffect(() => {
    fetchVehicles();
  }, [search, type, fuelType, minPrice, maxPrice]);

  const fetchVehicles = async () => {
    try {
      let query = `http://localhost:5000/api/vehicles?search=${search}`;
      if (type) query += `&type=${type}`;
      if (fuelType) query += `&fuelType=${fuelType}`;
      if (minPrice) query += `&minPrice=${minPrice}`;
      if (maxPrice) query += `&maxPrice=${maxPrice}`;

      const response = await axios.get(query);
      setVehicles(response.data);
    } catch (error) {
      console.error("Error fetching vehicle data:", error);
    }
  };

  return (
    <Container>
      <h1 className="my-4">Search & Filter Vehicles</h1>

      {/* Search & Filters */}
      <Form className="mb-4">
        <Row>
          <Col md={4}>
            <Form.Control
              type="text"
              placeholder="Search by name or brand"
              value={search}
              onChange={(e) => setSearch(e.target.value)}
            />
          </Col>
          <Col md={2}>
            <Form.Select value={type} onChange={(e) => setType(e.target.value)}>
              <option value="">All Types</option>
              <option value="Car">Car</option>
              <option value="Bike">Bike</option>
            </Form.Select>
          </Col>
          <Col md={2}>
            <Form.Select value={fuelType} onChange={(e) => setFuelType(e.target.value)}>
              <option value="">All Fuel Types</option>
              <option value="Petrol">Petrol</option>
              <option value="Diesel">Diesel</option>
              <option value="Electric">Electric</option>
              <option value="Hybrid">Hybrid</option>
            </Form.Select>
          </Col>
          <Col md={2}>
            <Form.Control
              type="number"
              placeholder="Min Price"
              value={minPrice}
              onChange={(e) => setMinPrice(e.target.value)}
            />
          </Col>
          <Col md={2}>
            <Form.Control
              type="number"
              placeholder="Max Price"
              value={maxPrice}
              onChange={(e) => setMaxPrice(e.target.value)}
            />
          </Col>
        </Row>
      </Form>

      {/* Vehicle Cards */}
      <Row>
        {vehicles.length > 0 ? (
          vehicles.map((vehicle) => (
            <Col key={vehicle._id} md={4} className="mb-4">
              <Card>
                <Card.Img variant="top" src={vehicle.imageUrl} alt={vehicle.name} />
                <Card.Body>
                  <Card.Title>{vehicle.name}</Card.Title>
                  <Card.Text>
                    <strong>Brand:</strong> {vehicle.brand} <br />
                    <strong>Price:</strong> â‚¹{vehicle.price} <br />
                    <strong>Fuel Type:</strong> {vehicle.fuelType}
                  </Card.Text>
                  <Link to={`/vehicles/${vehicle._id}`}>
                    <Button variant="primary">View Details</Button>
                  </Link>
                </Card.Body>
              </Card>
            </Col>
          ))
        ) : (
          <p>No vehicles found.</p>
        )}
      </Row>
    </Container>
  );
}

export default VehicleList;
